function Home() {
  return (
    <React.Fragment>
      <AppBar component="div" color="primary" position="static" elevation={0}>
        <Tabs value={0} textColor="inherit">
          <Tab textColor="inherit" label="Users" />
          <Tab textColor="inherit" label="Menu 2" />
          <Tab textColor="inherit" label="Menu 3" />
          <Tab textColor="inherit" label="Menu 4" />
        </Tabs>
      </AppBar>
    </React.Fragment>
  );
}

export default Home;
